import Button from 'react-bootstrap/Button';
import OverlayTrigger from 'react-bootstrap/OverlayTrigger';
import Tooltip from 'react-bootstrap/Tooltip';


const LandingPage = (props) => {



  return (
    <div className="Landing-container">
      <div className="container-fluid" id="childContainer">
        <h1 className="introduction"><h2 id="abth3">Hi, I am <span class="">Brandon Roulstone</span></h2></h1>
        <h3 className="fs-1">Aspiring software developer & designer</h3>
        <div className="landing-body">
          <div className="content-pg-lnd">
            <div className="landing-content">
              
            </div>
            <button className="btn-btn">
            <OverlayTrigger
              placement="right"
              delay={{ show: 250, hide: 400 }}
              overlay={renderTooltip}
            >
              <Button variant="success">Hover me to see</Button>
           </OverlayTrigger>
            </button>
          </div>
        </div>
        <div className="text-white d-flex justify-content-start container-fluid">Hello i am an icon</div>
      </div>
    </div>
  )
}

export default LandingPage;


